import React from 'react';
import './CS.css';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    



    
    <div className="sidebar">
      <div className="breadcrumb-container">
  <Link to="/" className="breadcrumb-link">Home</Link>
  | <Link to="/departments" className="breadcrumb-link">Departments</Link>
  | <Link to="/departments/computer-systems" className="breadcrumb-link">Computer Systems</Link>
  | Faculty
</div>
      <ul>
        <li><Link to="/cs">Home |</Link></li>
        <li><Link to="/cs/programs">Programs  |</Link></li>
        <li><Link to="/cs/faculty">Faculty |</Link></li>
        {/* Add more links for other sections as needed */}
      </ul>
    </div>
  );
};

export default Sidebar;
